import React from "react";
import "./output.css";

function LogoBar(props) {
  return (
    <div className="w-[18vw] h-[6vh] border border-white rounded-xl flex gap-4">
      {/* Dribbble */}
      <a href="https://dribbble.com/" target="_blank" rel="noopener noreferrer">
        <i className="fab fa-dribbble text-2xl text-pink-500 hover:text-pink-400"></i>
      </a>

      {/* GitHub */}
      <a href="https://github.com/" target="_blank" rel="noopener noreferrer">
        <i className="fab fa-github text-2xl text-white hover:text-gray-400"></i>
      </a>

      {/* LinkedIn */}
      <a
        href="https://www.linkedin.com/"
        target="_blank"
        rel="noopener noreferrer"
      >
        <i className="fab fa-linkedin text-2xl text-blue-600 hover:text-blue-400"></i>
      </a>

      {/* Email */}
      <a href="mailto:your@email.com">
        <i className="fas fa-envelope text-2xl text-gray-300 hover:text-gray-100"></i>
      </a>
    </div>
  );
}

export default LogoBar;
